function (inputs, outputs, adv) {
    const { state } = adv;
    const { r1, r2, r3 } = outputs;
    const curr = state.get("curr") || 0;

    const o = [r1, r2, r3][curr];

    const nextCurr = (curr + 1) % 3;

    o.next(inputs.item);
    state.set("curr", nextCurr);
  }
